import { Router, Routes, Route} from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import AdminFolder from './pages/AdminFolder';
import './app'

export const Link = () => {
    return (
        <Router>
            <Routes>
                <Route path="/">
                    <LoginPage />
                </Route>
                <Route path="/AdminFolder">
                    <AdminFolder />
                </Route>
            </Routes>
        </Router>
    )
}
